//  Andy Langton's show/hide/mini-accordion @ http://andylangton.co.uk/jquery-show-hide

$(function() {
	var showText='Mostrar';
	var hideText='Ocultar';

	var is_visible = false;

	var elements = $('.toggle');

	elements.prev().append(' <a href="#" class="toggleLink">'+hideText+'</a>');
	elements.show();

	elements.filter('.hide').each(function() {
		$(this).prev().children('.toggleLink').text(showText);
		$(this).slideUp(0);
	})

	$('a.toggleLink').click(function() {
		is_visible = !is_visible;

		if ($(this).text() == showText) {
			$(this).text(hideText);
			$(this).parent().next('.toggle').slideDown('slow');
		} else {
			$(this).text(showText);
			$(this).parent().next('.toggle').slideUp('slow');
		}

		return false;
	});
});
// make sure the $ is pointing to JQuery and not some other library
    (function($){
        // add a new method to JQuery

        $.fn.equalHeight = function() {
           // find the tallest height in the collection
           // that was passed in (.column)
            tallest = 0;
            this.each(function(){
                thisHeight = $(this).height();
                if( thisHeight > tallest)
                    tallest = thisHeight;
            });

            // set each items height to use the tallest value found
            this.each(function(){
                $(this).height(tallest);
            });
        }
    })(jQuery);
$(function(){
	var idioma = {
		"sProcessing": "Procesando...",
		"sLengthMenu": "Mostrar _MENU_ registros",
		"sZeroRecords": "No se encontraron resultados",
		"sInfo": "Mostrando desde _START_ hasta _END_ de _TOTAL_ registros",
		"sInfoEmpty":	"Mostrando desde 0 hasta 0 de 0 registros",
		"sInfoFiltered": "(filtrado de _MAX_ registros en total)",
		"sInfoPostFix":  "",
		"sSearch": "Buscar:",
		"sUrl": "",
		"oPaginate": {
			"sFirst": "Primero",
			"sPrevious": "Anterior",
			"sNext": "Siguiente",
			"sLast": "Último"
		}
	}

	$('.temporal').delay(5000).hide('slow');

	$('.tablesorter').dataTable({ oLanguage: idioma });
	$('.chosen-select').chosen();
	
	$('.column').equalHeight();

	$('.confirm').click(function(event) {
		if(confirm("¡Esta acción es permanente!, ¿seguro que quieres continuar?"))
			return true;

		return false;
	});
});